class LongTestArrayExpress(unittest.TestCase):

	@classmethod
	def setUpClass(cls):
		cls.cache_dirname = tempfile.mkdtemp()
		src = array_express.ArrayExpress(cache_dirname=cls.cache_dirname, download_backup=False, load_content=False)
		src.session.close()
		src.engine.dispose()
		download_ax.download_all_metadata(start_year=2001, end_year=2002)
		
	@classmethod
	def tearDownClass(cls):
		shutil.rmtree(cls.cache_dirname)
		shutil.rmtree("./AllExperiments")
		shutil.rmtree("./AllSamples")

	def setUp(self):
		self.src = array_express.ArrayExpress(cache_dirname=self.cache_dirname, download_backup=False, load_content=False)


	def test_load_all_metadata(self):
		src = self.src
		session = src.session

		src.load_experiments_from_text()
		src.load_samples_from_text()
		q = session.query(array_express.Experiment)
		self.assertEqual( q.count(), 26)
		self.assertTrue(checkEqual([c.name for c in q.all()], [u'Proteomic view of the Plasmodium falciparum life cycle', u'Bovine Glomerular and Aortic Endothelial Cells', u'Embryo development of Medicago truncatula', u'Transcription profiling of fission yeast meiosis and sporulation', u'Transcription profiling of fission yeast meiosis and sporulation', u'Transcription profiling of fission yeast meiosis and sporulation', u'Transcription profiling of fission yeast meiosis and sporulation', u'Transcription profiling of fission yeast meiosis and sporulation', u'Transcription profiling of fission yeast sexual differentiation', u'P19 embryonic carcinoma (EC) cells induced to form cardiomyocytes in vitro', u'mRNAs translated at eIF4F', u'Molecular portraits of human breast tumors', u'Diffuse large B-cell lymphoma', u'Human mammary epithelium and breast cancer', u'Antibody Array Figures', u'DNA copy-number changes', u'Secreted and membrane-associated genes', u'Stresses induce gene expression in Arabidopsis', u'Transcription profiling of human cell lines and tissues (Novartis/GNF)', u'SAGE profiles from cultured keratinocytes and human epidermis', u'Adaptive evolution in yeast', u'cdc15 block-release', u'Manipulation in phospate levels', u'eye-SAGE', u'Topoisomerase function in E. coli replication fork movement', u'Genetic diversity among Helicobacter pylori strains']))
		self.assertTrue(checkEqual([c.description for c in q.all()], [u'The completion of the Plasmodium falciparum clone 3D7 genome provides a basis on which to conduct comparative proteomics studies of this human pathogen. Here, we applied a high-throughput proteomics approach to identify new potential drug and vaccine targets and to better understand the biology of this complex protozoan parasite. We characterized four stages of the parasite life cycle (sporozoites, merozoites, trophozoites and gametocytes) by multidimensional protein identification technology. Functional profiling of over 2,400 proteins agreed with the physiology of each stage. Unexpectedly, the antigenically variant proteins of var and rif genes, defined as molecules on the surface of infected erythrocytes, were also largely expressed in sporozoites. The detection of chromosomal clusters encoding co-expressed proteins suggested a potential mechanism for controlling gene expression. Keywords: ordered', u'SAGE libraries were prepared from mRNA of cultured bovine glomerular and aortic endothelial cells. Cells both cell lines were positive for acetylated LDL uptake and vWF expression, and were proven to be free of non-endothelial cells.  Cultures were studied at passage 9-10. The cells were confluent, cultured in parallel, under identical conditions. Cells were plated on gelatin coated cell culture plastic in RPMI 1640 medium containing 10% FBS and streptomycin/penicillin. The last medium change was 48 hours prior to mRNA harvest. Keywords = endothelial, glomerular, kidney, aorta, Keywords: other', u'Early stage of embryo development from leaf-derived embryogenic callus of M. truncatula.', u'Transcriptional profile of fission yeast meiosis and sporulation. Fission yeast cells undergo meiosis and sporulation under conditions of nutritional stress, most frequently nitrogen starvation.  This is a complex developmental process, which results in the formation of four spores that are highly resistant to environmental stress. We have carried out time courses of diploid fission yeast cells undergoing meiosis and sporulation. To achieve the best possible synchrony we have used thermosensitive mutants in the meiotic inhibitor pat1. We first pre-synchronized the cells in G1 by removal of nitrogen at the permissive temperature for pat1, and then induced meiosis by inactivating pat1 with a temperature shift. pat1-induced meiosis is a standard technique, resulting in a highly synchronous meiosis that is very similar to the normal process. The use of pat1 mutants and a temperature-shift may cause some artifacts, so these results should be viewed together with temperature shift controls and especially with the results of the time course done with wild type diploids, available under accession numbers E-SNGR-3 to E-SNGR-7. In all cases we used as reference a pool consisting of equal amounts of RNA  from all time points of the experiment. This experiment describes the first biological replicate for pat1 using array design A-SNGR-2. Note that there are three other biological replicates, which use array design A-SNGR-1 in experiment E-SNGR-2.', u'pat1 meiosis is very synchronous (see E-SNGR-2), but the use of a temperature shift and the prolonged nitrogen starvation can lead to artifacts. As a control for the pat1 experiment,non-sporulating pat1+ diploids were treated exactly as in the protocol for pat1 cells, with the exception that no nitrogen was added at the time of the temperature shift. Under these conditions the cells remain blocked in G1.  As a reference we used a pool consisting of equal amount of RNA from all time points of the experiments. This experiment is part of a series, E-SNGR-2 to E-SNGR-7.', u'pat1 meiosis is very synchronous (see E-SNGR-2), but the use of a temperature shift and the prolonged nitrogen starvation can lead to artifacts. As a control for the E-SNGR-2 experiment, non-sporulating pat1+ diploids were treated exactly as in the protocol for E-SNGR-2  cells. Under these conditions the cells re-enter the mitotic cycle.  As a reference we used a pool consisting of equal amount of RNA from all time points of the experiments. This experiment is part of a series, E-SNGR-2 to E-SNGR-7.', u'Study of the meiotic transcriptional profile of transcription factor mutants. The transcription factors atf21 and atf31 are highly induced during the meiotic divisions and required for proper spore formation. To identify possible targets of these transcription factors we compared the transcriptional profile of atf21 and atf31 mutants with that of wild type cells undergoing meiosis.  We used haploid h90 cells for this experiment. Removal of nitrogen from the medium induces mating to form diploids, which immediately undergo meiosis and sporulation. This type of meiosis is not very synchronous. This experiment is part of a series, E-SNGR-2 to E-SNGR-7.', u'Fission yeast cells undergo meiosis and sporulation under conditions of nutritional stress, most frequently nitrogen starvation. This is a complex developmental process, which results in the formation of four spores that are highly resistant to environmental stress. We have carried out time course experiments with diploid fission yeast cells undergoing meiosis and sporulation. In this experiment we have used wild type diploids, and induced meiosis by removal of nitrogen from the medium. As a reference we used a pool consisting of equal amount of RNA from all time points of the experiments. This experiment is part of a series, with accession numbers E-SNGR-2 to E-SNGR-7.', None, u'SAGE identification of differentiation responsive genes in P19 embryonic cells induced to form cardiomyocytes in vitro. P19 embryonic carcinoma (EC) cells, induced to form cardiomyocytes in vitro - undifferentiated cells, day 3+0.5 and day 3+3.0 of differentiation protocol. Keywords = EC cells, P19, differentiation, cardiomyocytes Keywords: time-course', u"Identification of eukaryotic mRNAs that are translated at reduced cap binding complex eIF4F concentrations using a cDNA microarray. Although most eukaryotic mRNAs need a functional cap binding complex eIF4F for efficient 5' end-dependent scanning to initiate translation, picornaviral, hepatitis C viral, and a few cellular RNAs have been shown to be translated by internal ribosome entry, a mechanism that can operate in the presence of low levels of functional eIF4F. To identify cellular mRNAs that can be translated when eIF4F is depleted or in low abundance and that, therefore, may contain internal ribosome entry sites, mRNAs that remained associated with polysomes were isolated from human cells after infection with poliovirus and were identified by using a cDNA microarray. Approximately 200 of the 7000 mRNAs analyzed remained associated with polysomes under these conditions. Among the gene products encoded by these polysome-associated mRNAs were immediate-early transcription factors, kinases, and phosphatases of the mitogen-activated protein kinase pathways and several protooncogenes, including c-myc and Pim-1. In addition, the mRNA encoding Cyr61, a secreted factor that can promote angiogenesis and tumor growth, was selectively mobilized into polysomes when eIF4F concentrations were reduced, although its overall abundance changed only slightly. Subsequent tests confirmed the presence of internal ribosome entry sites in the 5' noncoding regions of both Cyr61 and Pim-1 mRNAs. Overall, this study suggests that diverse mRNAs whose gene products have been implicated in a variety of stress responses, including inflammation, angiogenesis, and the response to serum, can use translational initiation mechanisms that require little or no intact cap binding protein complex eIF4F. This study is described more fully in Johannes G et al.(1999) Proc Natl Acad Sci U S A 96:13118-23.", u'Set of 65 surgical specimens of human breast tumors from 42 different individuals, using complementary DNA microarrays representing 8,102 human genes. Gene expression variation patterns within this set provided a distinctive molecular portrait of each tumor. Twenty of the tumors were sampled twice, before and after a 16-week course of doxorubicin chemotherapy, and two tumors were paired with a lymph node metastasis from the same patient. Gene expression patterns in two tumor samples from the same individual were almost always more similar to each other than either was to any other sample. This study is described more fully in Perou CM et al.(2000) Nature 406:747-52', u"Diffuse large B-cell lymphoma (DLBCL), the most common subtype of non-Hodgkin's lymphoma, is clinically heterogeneous: 40% of patients respond well to current therapy and have prolonged survival, whereas the remainder succumb to the disease. We proposed that this variability in natural history reflects unrecognized molecular heterogeneity in the tumors. Using DNA microarrays, we have conducted a systematic characterization of gene expression in B-cell malignancies. Here we show that there is diversity in gene expression among the tumors of DLBCL patients, apparently reflecting the variation in tumor proliferation rate, host response and differentiation state of the tumor. We identified two molecularly distinct forms of DLBCL which had gene expression patterns indicative of different stages of B-cell differentiation. One type expressed genes characteristic of germinal center B cells ('germinal center B-like DLBCL'); the second type expressed genes normally induced during in vitro activation of peripheral blood B cells ('activated B-like DLBCL'). Patients with germinal center B-like DLBCL had a significantly better overall survival than those with activated B-like DLBCL. The molecular classification of tumors on the basis of gene expression can thus identify previously undetected and clinically significant subtypes of cancer. This study is described more fully in Alizadeh AA et al.(2000) Nature 403:503-11", u'Distinctive gene expression patterns in human mammary epithelial cells and breast cancers. cDNA microarrays and a clustering algorithm were used to identify patterns of gene expression in human mammary epithelial cells growing in culture and in primary human breast tumors. Clusters of coexpressed genes identified through manipulations of mammary epithelial cells in vitro also showed consistent patterns of variation in expression among breast tumor samples. By using immunohistochemistry with antibodies against proteins encoded by a particular gene in a cluster, the identity of the cell type within the tumor specimen that contributed the observed gene expression pattern could be determined. Clusters of genes with coherent expression patterns in cultured cells and in the breast tumors samples could be related to specific features of biological variation among the samples. Two such clusters were found to have patterns that correlated with variation in cell proliferation rates and with activation of the IFN-regulated signal transduction pathway, respectively. Clusters of genes expressed by stromal cells and lymphocytes in the breast tumors also were identified in this analysis. These results support the feasibility and usefulness of this systematic approach to studying variation in gene expression patterns in human cancers as a means to dissect and classify solid tumors. This study is described more fully in Perou CM, et al. 1999. Proc Natl Acad Sci USA 96:9212-7', u'Protein microarrays for highly parallel detection and quantitation of specific proteins and antibodies in complex solutions. This study is described more fully in Haab, Dunham, and Brown, Genome Biology 2001 2(2): research0004.1-0004.13.', u'Gene amplifications and deletions frequently contribute to tumorigenesis. Characterization of these DNA copy-number changes is important for both the basic understanding of cancer and its diagnosis. Comparative genomic hybridization (CGH) was developed to survey DNA copy-number variations across a whole genome. With CGH, differentially labelled test and reference genomic DNAs are co-hybridized to normal metaphase chromosomes, and fluorescence ratios along the length of chromosomes provide a cytogenetic representation of DNA copy-number variation. CGH, however, has a limited ( approximately 20 Mb) mapping resolution, and higher-resolution techniques, such as fluorescence in situ hybridization (FISH), are prohibitively labour-intensive on a genomic scale. Array-based CGH, in which fluorescence ratios at arrayed DNA elements provide a locus-by-locus measure of DNA copy-number variation, represents another means of achieving increased mapping resolution. Published array CGH methods have relied on large genomic clone (for example BAC) array targets and have covered only a small fraction of the human genome. cDNAs representing over 30,000 radiation-hybrid (RH)-mapped human genes provide an alternative and readily available genomic resource for mapping DNA copy-number changes. Although cDNA microarrays have been used extensively to characterize variation in human gene expression, human genomic DNA is a far more complex mixture than the mRNA representation of human cells. Therefore, analysis of DNA copy-number variation using cDNA microarrays would require a sensitivity of detection an order of magnitude greater than has been routinely reported. We describe here a cDNA microarray-based CGH method, and its application to DNA copy-number variation analysis in breast cancer cell lines and tumours. This study is described more fully in Pollack JR et al.(1999) Nat Genet 23:41-6', u'Large-scale identification of secreted and membrane-associated gene products using DNA microarrays. This study is described more fully in Diehn M et al.(2000) Nat Genet 25:58-62', u'UV-B light and Gamma-ray treated plantlet.', u'High-throughput gene expression profiling has become an important tool for investigating transcriptional activity in a variety of biological samples. To date, the vast majority of these experiments have focused on specific biological processes and perturbations. Here, we have generated and analyzed gene expression from a set of samples spanning a broad range of biological conditions. Specifically, we profiled gene expression from 91 human and mouse samples across a diverse array of tissues, organs, and cell lines. Because these samples predominantly come from the normal physiological state in the human and mouse, this dataset represents a preliminary, but substantial, description of the normal mammalian transcriptome. We have used this dataset to illustrate methods of mining these data, and to reveal insights into molecular and physiological gene function, mechanisms of transcriptional regulation, disease etiology, and comparative genomics. Finally, to allow the scientific community to use this resource, we have built a free and publicly accessible website (<a href="http://expression.gnf.org" target="_blank">http://expression.gnf.org</a>) that integrates data visualization and curation of current gene annotations. The terms of the Novartis data release policy prevent us from redistributing .cel files for this experiment, therefore there is no raw data, we hope to be able to release this in future.', u'SAGE libraries from cultured, differentiated keratinocytes and human epidermis, both normal and affected by actinic keratosis Keywords = Keratinocyte, Epidermis, Homo sapiens, Actinic Keratosis, TNF alpha', u'A Saccharomyces cerevisiae population was cultured for many generations under conditions to which it is not optimally adapted. These experiments were designed to investigate adaptive evolution under natural selection. This study is described in more detail in Ferea TL, et al. 1999. Proc Natl Acad Sci USA 96:9721-6', u'Yeast cells were blocked in telophase using a cdc15-2 temperature senstive mutant at restrictive temperature. The culture was then shifted to permissive temperature (25oC), and released into the cell cycle. Samples were then taken during the course of almost three full cell cycles. This study is described in more detail in Spellman PT et al.(1998) Mol Biol Cell 9:3273-97', u'The arrays were used to study the effects of modifying phosphate levels in yeast, either through mutation, or chemical manipulation. This study is described in more detail in Ogawa N et al.(2000) Mol Biol Cell 11:4309-21', u'Human retinal and RPE SAGE libraries. Profile of the genes expressed in the human peripheral retina, macula, and retinal pigment epithelium determined through serial analysis of gene expression (SAGE). Keywords: other', u'Analysis of topoisomerase function in bacterial replication fork movement: use of DNA microarrays. We used DNA microarrays of the Escherichia coli genome to trace the progression of chromosomal replication forks in synchronized cells. We found that both DNA gyrase and topoisomerase IV (topo IV) promote replication fork progression. When both enzymes were inhibited, the replication fork stopped rapidly. The elongation rate with topo IV alone was 1/3 of normal. Genetic data confirmed and extended these results. Inactivation of gyrase alone caused a slow stop of replication. Topo IV activity was sufficient to prevent accumulation of (+) supercoils in plasmid DNA in vivo, suggesting that topo IV can promote replication by removing (+) supercoils in front of the chromosomal fork. This study is detailed in Khodursky AB et al.(2000) Proc Natl Acad Sci U S A 97:9419-24 Keywords: other', u"Helicobacter pylori colonizes the stomach of half of the world's population, causing a wide spectrum of disease ranging from asymptomatic gastritis to ulcers to gastric cancer. Although the basis for these diverse clinical outcomes is not understood, more severe disease is associated with strains harboring a pathogenicity island. To characterize the genetic diversity of more and less virulent strains, we examined the genomic content of 15 H. pylori clinical isolates by using a whole genome H. pylori DNA microarray. We found that a full 22% of H. pylori genes are dispensable in one or more strains, thus defining a minimal functional core of 1281 H. pylori genes. While the core genes encode most metabolic and cellular processes, the strain-specific genes include genes unique to H. pylori, restriction modification genes, transposases, and genes encoding cell surface proteins, which may aid the bacteria under specific circumstances during their long-term infection of genetically diverse hosts. We observed distinct patterns of the strain-specific gene distribution along the chromosome, which may result from different mechanisms of gene acquisition and loss. Among the strain-specific genes, we have found a class of candidate virulence genes identified by their coinheritance with the pathogenicity island."]))
